    <div id="page_wrapper">
      <Component 
        {...pageProps} 
      />
    </div>
  )

  React.useEffect(() => {
    addMomentum();
    window.addEventListener('scroll', scroll);
  });

  function scroll() {
      console.log("deltaY = " + window.pageYOffset);
  }

  function addMomentum() {
    console.log(page_wrapper);
    let scrollY = 0;
    let containerY = 0;
  }

  return (
    {page_wrapper}
  )
}
